solution:
We substitute these two points into the given equation to solve for $c$. Plugging in $(-1,-11)$, we get $-11=(-1)^2-1b+c\Rightarrow -b+c=-12$. Plugging in $(3,17)$, we get $17=3^2+3b+c \Rightarrow 3b+c=8$. In summary, we have the two equations \begin{align*}
-b+c&=-12\\
3b+c&=8
\end{align*} Multiplying the first equation by 3, we have $-3b+3c=-36$. Adding the second equation to this last one, we have $(-3b+3c)+(3b+c)=-36+8 \Rightarrow c=\boxed{-7}$.

The parabola is graphed below: [asy]

Label f;

f.p=fontsize(4);

xaxis(-9,4,Ticks(f, 2.0));

yaxis(-13,17,Ticks(f, 2.0));

real f(real x)

{

return x^2+5x-7;

}

draw(graph(f,-8,3), Arrows(4));

[/asy]

question:
A circle of radius 1 is internally tangent to two circles of radius 2 at points  $A$ and $B$, where $AB$ is a diameter of the smaller circle. What is the  area of the region, shaded in the figure, that is outside  the smaller circle and inside each of the two larger circles? Express your answer in terms of $\pi$ and in simplest radical form.

[asy]
unitsize(1cm);
pair A = (0,-1), B = (0,1);
fill(arc(A,2,30,90)--arc((0,0),1,90,-90)--arc(B,2,270,330)--cycle,gray(0.7));
fill(arc(A,2,90,150)--arc(B,2,210,270)--arc((0,0),1,270,90)--cycle,gray(0.7));
draw(Circle((0,-1),2));
draw(Circle((0,1),2));
draw(Circle((0,0),1));
draw((0,0)--(0.71,0.71),Arrow);
draw((0,-1)--(-1.41,-2.41),Arrow);
draw((0,1)--(1.41,2.41),Arrow);
dot((0,-1));
dot((0,1));
label("$A$",A,S);
label("$B$",B,N);
label("2",(0.7,1.7),N);
label("2",(-0.7,-1.7),N);
label("1",(0.35,0.35),N);
[/asy]

solution:
The centers of the two larger circles are at $A$ and $B$. Let $C$ be the center of the smaller circle, and let $D$ be one of the points of intersection of the two larger circles.

[asy]
unitsize(1cm);
pair A = (0,-1), B = (0,1);
fill(arc(A,2,30,90)--arc((0,0),1,90,0)--cycle,gray(0.7));
draw(Circle((0,-1),2));
draw(Circle((0,1),2),dashed);
draw(Circle((0,0),1),dashed);
label("$C$",(0,0),NW);
label("$D$",(1.73,0),E);
draw((0,0)--(0,-1)--(1.73,0)--cycle,linewidth(0.7));
label("2",(0.8,-0.5),N);
label("$\sqrt{3}$",(0.5,0),N);
label("1",(0,-0.5),W);
dot((0,-1));
dot((0,1));
label("$A$",(0,-1),S);
label("$B$",(0,1),N);
[/asy]

Then $\triangle ACD$ is a right triangle with $AC=1$ and $AD=2$, so $CD =\sqrt{3}$, $\angle CAD = 60^{\circ}$, and the area of $\triangle ACD$ is $\sqrt{3}/2$. The area of 1/4 of the shaded region, as shown in the figure, is the area of sector $BAD$ of the circle centered at $A$, minus the area of $\triangle ACD$, minus the area of 1/4 of the smaller circle. That area is

\[
\frac{2}{3}\pi -\frac{\sqrt{3}}{2}- \frac{1}{4}\pi = \frac{5}{12}\pi - \frac{\sqrt{3}}{2},
\]so the area of the entire shaded region is \[
4\left(\frac{5}{12}\pi - \frac{\sqrt{3}}{2}\right) =
\boxed{\frac{5}{3}\pi - 2\sqrt{3}}.
\]

question:
Triangle $PAB$ is formed by three tangents to circle $O$ and $\angle APB = 40^\circ$.  Find $\angle AOB$.

[asy]
import graph;

unitsize(1.5 cm);

pair A, B, O, P, R, S, T;

R = dir(115);
S = dir(230);
T = dir(270);
P = extension(R, R + rotate(90)*(R), T, T + rotate(90)*(T));
A = extension(S, S + rotate(90)*(S), T, T + rotate(90)*(T));
B = extension(R, R + rotate(90)*(R), S, S + rotate(90)*(S));

draw(Circle((0,0),1));
draw((R + 0.1*(R - P))--P--(T + 0.1*(T - P)));
draw(A--B--O--cycle);

label("$A$", A, dir(270));
label("$B$", B, NW);
label("$O$", O, NE);
label("$P$", P, SW);
label("$R$", R, NW);
//label("$S$", S, NE);
label("$T$", T, dir(270));
[/asy]

solution:
Since $\angle C = 45^\circ$, triangle $ACD$ is a $45^\circ$-$45^\circ$-$90^\circ$ triangle, which means $AD = CD = AC/\sqrt{2} = 3$.  Then $BD = BC - CD = 4 - 3 = 1$.

[asy]
unitsize(1 cm);

pair A, B, C, D, E, F, H;

A = (1,3);
B = (0,0);
C = (4,0);
D = (A + reflect(B,C)*(A))/2;
E = (B + reflect(C,A)*(B))/2;
F = (C + reflect(A,B)*(C))/2;
H = extension(B,E,C,F);

draw(A--B--C--cycle);
draw(A--D);
draw(B--E);
draw(C--F);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
label("$E$", E, NE);
label("$F$", F, NW);
label("$H$", H, SE);
[/asy]

Also, $\angle EBC = 90^\circ - \angle BCE = 45^\circ$, so triangle $BHD$ is a $45^\circ$-$45^\circ$-$90^\circ$ triangle.  Hence, $HD = BD = 1$.  Then $AH = AD - HD = 3 - 1 = 2$, so $AH:HD = \boxed{2}$.

